            'value' => 'Devo is an American rock group formed in Akron, Ohio, United States in 1972. The band split in 1991 and returned in 1996. The band currently consists of Gerald Casale (vocals, bass), Mark Mothersbaugh (vocals, synthesizer), Bob Mothersbaugh (guitar) and Josh Freese (drums). Former members include Bob Casale (guitar, keyboards) (born July 14, 1952; died February 17, 2014) and Alan Myers (drums) (born 1955; died 2013). The band released their first album in 20 years, "Something for Everybody" on June 15, 2010. <a href="https://www.last.fm/music/Devo">Read more on Last.fm</a>',
