                ),
                39 => 
                array (
                    'name' => 'summary',
                'value' => 'Don McLean (born October 2, 1945 in New Rochelle, New York) is an American singer-songwriter, most famous for his 1971 song "American Pie", released from the album of the same name, about the plane crash that killed Buddy Holly, Richie Valens, and The Big Bopper (Jiles Perry (J.P.) (Jape)  Richardson, Jr.). The song, an international number one single, spawned the phrase "The Day the Music Died," referring to the day of the crash [3 February 1959]. It was later listed as the No. 5 song on the RIAA project \'Songs of the Century\'.  <a href="https://www.last.fm/music/Don+McLean">Read more on Last.fm</a>',
                    'artist_id' => 42,
                    'created_at' => '2018-04-28 12:34:57',
                    'updated_at' => '2018-04-28 12:34:57',
                ),
