                array (
                    'name' => 'summary',
                    'value' => 'Front man required. Don\'t bother applying; its not happening. Amen.




R.I.P. Jim Morrison

<a href="https://www.last.fm/music/+noredirect/Doors,+The">Read more on Last.fm</a>',
