                    'updated_at' => '2018-04-28 12:34:59',
                ),
                41 => 
                array (
                    'name' => 'summary',
                'value' => 'Dusty Springfield (born Mary Isobel Catherine Bernadette O\'Brien on 16 April 1939 – died 2 March 1999) was a British pop singer. Of the female artists of the British Invasion, Springfield made the biggest impression on the U.S. market. From 1963 to 1970, she scored 18 singles in the Billboard Hot 100. She was voted the Top British Female Artist by readers of New Musical Express in 1964, 1965, and 1968. Springfield is an inductee of the Rock and Roll Hall of Fame and the UK Music Hall of Fame. <a href="https://www.last.fm/music/Dusty+Springfield">Read more on Last.fm</a>',
                    'artist_id' => 45,
                    'created_at' => '2018-04-28 12:35:02',
                    'updated_at' => '2018-04-28 12:35:02',
                ),
                42 => 
                array (
                    'name' => 'summary',
                    'value' => 'This is a mis-tagged band name. The official name has an ampersand in it. Please fix your tags to read Earth, Wind & Fire <a href="https://www.last.fm/music/+noredirect/Earth,+Wind+and+Fire">Read more on Last.fm</a>',
                    'artist_id' => 46,
                    'created_at' => '2018-04-28 12:35:03',
                    'updated_at' => '2018-04-28 12:35:03',
                ),
                43 => 
                array (
                    'name' => 'summary',
                'value' => 'Sir Elton Hercules John, CBE (born Reginald Kenneth Dwight in Pinner, Middlesex, England on 25 March 1947) is an immensely popular English singer, composer (mostly with lyricist Bernie Taupin) and pianist. In a career spanning five decades, Elton John has sold over 250 million records and has over fifty Top 40 hits, making him one of the most successful musicians of all time. His 1997 tribute to Diana, Princess of Wales, " Candle In The Wind 1997," remains the world\'s biggest selling and fastest selling single of all time. <a href="https://www.last.fm/music/Elton+John">Read more on Last.fm</a>',
                    'artist_id' => 47,
                    'created_at' => '2018-04-28 12:35:05',
                    'updated_at' => '2018-04-28 12:35:05',
                ),
                44 => 
                array (
                    'name' => 'summary',
                'value' => 'Elvis Aaron Presley[a] (January 8, 1935 – August 16, 1977) was an American singer and actor. Regarded as one of the most significant cultural icons of the 20th century, he is often referred to as the "King of Rock and Roll" or simply "the King".

Presley was born in Tupelo, Mississippi, and relocated to Memphis, Tennessee, with his family when he was 13 years old. His music career began there in 1954, recording at Sun Records with producer Sam Phillips, who wanted to bring the sound of African American music to a wider audience. <a href="https://www.last.fm/music/Elvis+Presley">Read more on Last.fm</a>',
                    'artist_id' => 48,
                    'created_at' => '2018-04-28 12:35:06',
                    'updated_at' => '2018-04-28 12:35:06',
                ),
                45 => 
                array (
                    'name' => 'summary',
                'value' => 'Marshall Bruce Mathers III (born October 17, 1972),  better known by his stage name Eminem/Slim Shady is an American rapper and record producer.  Eminem learned his trade while growing up in Detroit, United States, and quickly gained popularity in 1999 with his major-label album, The Slim Shady LP, which won a Grammy Award for Best Rap Album. The following album, The Marshall Mathers LP, became the fastest-selling solo album in the United States history. <a href="https://www.last.fm/music/Eminem">Read more on Last.fm</a>',
                    'artist_id' => 49,
                    'created_at' => '2018-04-28 12:35:08',
                    'updated_at' => '2018-04-28 12:35:08',
                ),
                46 => 
                array (
                    'name' => 'summary',
                'value' => 'Eric Clapton (born Eric Patrick Clapton in Ripley, Surrey, England on 30 March 1945), nicknamed "Slowhand", is a Grammy Award winning English composer, singer and guitarist who became one of the most respected artists of the rock era, winning three inductions into the Rock and Roll Hall of Fame. 

Clapton\'s musical style has changed during his career, but has remained rooted in the blues. Clapton is credited as an innovator in several phases of his career <a href="https://www.last.fm/music/Eric+Clapton">Read more on Last.fm</a>',
                    'artist_id' => 50,
                    'created_at' => '2018-04-28 12:35:09',
                    'updated_at' => '2018-04-28 12:35:09',
                ),
                47 => 
                array (
                    'name' => 'summary',
                    'value' => 'Fleetwood Mac is a British and American blues band formed in 1967. From the band\'s inception through the end of 1974, no incarnation of Fleetwood Mac lasted longer than two years, but all featured core members Mick Fleetwood and John McVie. Their two most successful periods have been during the late 60s British blues boom, when they were led by guitarist/singer-songwriter Peter Green, and from 1975 to 1987, when they went a pop-oriented direction with musicians Christine McVie, Lindsey Buckingham, and Stevie Nicks. <a href="https://www.last.fm/music/Fleetwood+Mac">Read more on Last.fm</a>',
                    'artist_id' => 51,
                    'created_at' => '2018-04-28 12:35:11',
                    'updated_at' => '2018-04-28 12:35:11',
                ),
                48 => 
                array (
                    'name' => 'summary',
                    'value' => 'Flight of the Conchords is a Grammy award-winning folk/pop/comedy duo comprised of Bret McKenzie formerly of The Black Seeds, Video Kid, and The Wellington International Ukulele Orchestra fame and Jemaine Clement formerly of The Humourbeasts, who met in 1998 while studying film and theatre in Wellington, New Zealand.  Billing themselves as "New Zealand\'s fourth most popular guitar-based digi-bongo acapella-rap-funk-comedy folk duo", the group uses a combination of witty banter and acoustic guitars to work the audience. <a href="https://www.last.fm/music/Flight+of+the+Conchords">Read more on Last.fm</a>',
                    'artist_id' => 52,
                    'created_at' => '2018-04-28 12:35:12',
                    'updated_at' => '2018-04-28 12:35:12',
                ),
                49 => 
                array (
                    'name' => 'summary',
                    'value' => 'This is an incorrect tag for the band Florence + The Machine. Songs scrobbled to this incorrect tag will automatically redirect to the correct tag if Autocorrection is turned on. However, it is recommended that you change your ID3 tags to the correct artist name. <a href="https://www.last.fm/music/+noredirect/Florence+++The+Machine">Read more on Last.fm</a>',
