                ),
                50 => 
                array (
                    'name' => 'summary',
                    'value' => 'Fool\'s Garden is a German pop group formed in 1991, comprising singer Peter Freudenthaler, guitarist Volker Hinkel, bassist Thomas Mangold, keyboardist Roland Röhl, and drummer Ralf Wochele. 

Their first album, Once in a Blue Moon was released in 1993, followed two years later by Dish of the Day, from which "Lemon Tree" became an Asian chart hit. Go and Ask Peggy for the Principal Thing followed in 1997, then For Sale (2000), 25 Miles to Kissimmee (2003), and Ready for the Real Life (2005). <a href="https://www.last.fm/music/Fool%27s+Garden">Read more on Last.fm</a>',
                    'artist_id' => 54,
                    'created_at' => '2018-04-28 12:35:15',
                    'updated_at' => '2018-04-28 12:35:15',
                ),
                51 => 
                array (
                    'name' => 'summary',
                'value' => 'Foster the People is an indie rock/indie pop band that formed in Los Angeles, California, United States in 2009. The band consists of Mark Foster (vocals, guitar, keyboards), Cubbie Fink (bass, vocals) and Mark Pontius (drums). The band released their debut self-titled EP in January 2011. The band\'s debut full length album, Torches, was released on May 24, 2011 on Star Time/Columbia. Their first single "Pumped Up Kicks" was a sleeper hit during the summer of 2011 and peaked at #1 on the Billboard Alternative Songs Chart <a href="https://www.last.fm/music/Foster+the+People">Read more on Last.fm</a>',
                    'artist_id' => 55,
                    'created_at' => '2018-04-28 12:35:17',
                    'updated_at' => '2018-04-28 12:35:17',
                ),
                52 => 
                array (
                    'name' => 'summary',
                'value' => 'Francis Albert Sinatra (December 12, 1915 – May 14, 1998) was an American singer, actor, and producer who was one of the most popular and influential musical artists of the 20th century. He is one of the best-selling music artists of all time, having sold more than 150 million records worldwide. 

Born in Hoboken, New Jersey, to Italian immigrants, Sinatra began his musical career in the swing era with bandleaders Harry James and Tommy Dorsey. Sinatra found success as a solo artist after he signed with Columbia Records in 1943 <a href="https://www.last.fm/music/Frank+Sinatra">Read more on Last.fm</a>',
                    'artist_id' => 56,
                    'created_at' => '2018-04-28 12:35:18',
                    'updated_at' => '2018-04-28 12:35:18',
                ),
                53 => 
                array (
                    'name' => 'summary',
                'value' => 'Franz Ferdinand is a Scottish rock band that formed in Glasgow, Scotland, United Kingdom, in 2002 and played an important part in the post-punk revival of the 2000s. The band is composed of Alex Kapranos (lead vocals and guitar), Bob Hardy (bass guitar), Nick McCarthy (rhythm guitar, keyboards and backing vocals) and Paul Thomson (drums, percussion and backing vocals).

The band first experienced chart success when their second single "Take Me Out" reached #3 in the UK Charts <a href="https://www.last.fm/music/Franz+Ferdinand">Read more on Last.fm</a>',
                    'artist_id' => 57,
                    'created_at' => '2018-04-28 12:35:20',
