                ),
                55 => 
                array (
                    'name' => 'summary',
                'value' => 'Gloria Gaynor (born Gloria Fowles 7 September 1949) is an American singer-songwriter born in Newark, New Jersey, USA. She is  best-known for the disco era hits "I Will Survive" (Hot 100 #1, 1979), "Never Can Say Goodbye" (Hot 100 #9, 1974), "Let Me Know (I Have A Right)" (Hot 100 #42, 1980) and "I Am What I Am" (Hot 100 #82, 1983). Some of her other hits include "I Never Knew", "Just Keep Thinking About You", "Last Night", "Mighty High", "Be Soft With Me Tonight" <a href="https://www.last.fm/music/Gloria+Gaynor">Read more on Last.fm</a>',
                    'artist_id' => 59,
                    'created_at' => '2018-04-28 12:35:23',
                    'updated_at' => '2018-04-28 12:35:23',
                ),
                56 => 
                array (
                    'name' => 'summary',
                    'value' => 'Gorillaz are a British virtual band formed in 1998 by  Damon Albarn of  Blur, and Jamie Hewlett, co-creator of the comic book Tank Girl. They had the idea to create the band while watching MTV in their London flat and originally intended to call the project Gorilla.

The band consists of four fictional band members: 2-D (vocals, keyboard), Murdoc Niccals (bass), Noodle (guitar, vocals), and Russel Hobbs (drums). These characters only appear in animated form and are not alter-egos of real people, as is often mistakenly assumed. <a href="https://www.last.fm/music/Gorillaz">Read more on Last.fm</a>',
                    'artist_id' => 60,
                    'created_at' => '2018-04-28 12:35:24',
                    'updated_at' => '2018-04-28 12:35:24',
                ),
                57 => 
                array (
                    'name' => 'summary',
                'value' => 'Green Day is an American punk rock band formed in 1986. The band consists of lead vocalist and guitarist Billie Joe Armstrong, bassist and backing vocalist Mike Dirnt, drummer Tré Cool and guitarist and backing vocalist Jason White, who became a full member after playing in the band as a session and touring guitarist for 13 years. Cool replaced former drummer John Kiffmeyer in 1990, prior to the recording of the band\'s second studio album, Kerplunk (1992). <a href="https://www.last.fm/music/Green+Day">Read more on Last.fm</a>',
                    'artist_id' => 61,
                    'created_at' => '2018-04-28 12:35:26',
