                ),
                59 => 
                array (
                    'name' => 'summary',
                    'value' => 'There is more than one artist with this name:

1) Heart got their start in 1963 in Seattle, Washington formed by bassist Steve Fossen and brothers Roger Fisher (guitar/mandolin) and Mike Fisher (producer and sound engineer). The group went by the names Army and White Heart before settling on just Heart in the early 1970s. Ann Wilson joined the group in 1970. Romance sprang up between her and Mike, and she came along when they moved to Vancouver to avoid the Vietnam draft some years later. <a href="https://www.last.fm/music/Heart">Read more on Last.fm</a>',
                    'artist_id' => 63,
                    'created_at' => '2018-04-28 12:35:29',
                    'updated_at' => '2018-04-28 12:35:29',
                ),
                60 => 
                array (
                    'name' => 'summary',
                'value' => 'Hole was an American alternative rock band that formed in Los Angeles, California in 1989 by singer-songwriter and guitarist Courtney Love and lead guitarist Eric Erlandson. The band went through various lineups through the subsequent decades before its dissolution in 2002. In 2009, frontwoman Love re-formed Hole with lead guitarist Micko Larkin (formerly of Larrikin Love), Shawn Dailey (of Rock Kills Kid) on bass, and Stuart Fisher (formerly of Ozric Tentacles) on drums, but retired the Hole moniker in 2012, returning to work as a solo artist. <a href="https://www.last.fm/music/Hole">Read more on Last.fm</a>',
                    'artist_id' => 64,
                    'created_at' => '2018-04-28 12:35:31',
                    'updated_at' => '2018-04-28 12:35:31',
                ),
                61 => 
                array (
                    'name' => 'summary',
                    'value' => 'Incorrect tag for the band  The Human League. Keep stats clean and add the correct artist name to your ID3 tags to avoid incorrect or duplicate artists. <a href="https://www.last.fm/music/+noredirect/Human+League">Read more on Last.fm</a>',
                    'artist_id' => 65,
                    'created_at' => '2018-04-28 12:35:32',
                    'updated_at' => '2018-04-28 12:35:32',
                ),
                62 => 
                array (
                    'name' => 'summary',
                'value' => 'Iggy Pop (born James Newell Osterberg, Jr.; April 21, 1947) is an American singer, songwriter, musician, and actor. Though widely known as an innovator and "godfather" of punk rock, Pop\'s music has encompassed a number of styles over the years, including pop, hard rock, jazz and blues. Pop became known as \'Iggy\' in high school, during which time he served as drummer for local blues band The Iguanas. He is vocalist of influential proto-punk band The Stooges (Pop and the other surviving members of the group reunited in 2003) <a href="https://www.last.fm/music/Iggy+Pop">Read more on Last.fm</a>',
                    'artist_id' => 66,
                    'created_at' => '2018-04-28 12:35:33',
                    'updated_at' => '2018-04-28 12:35:33',
                ),
                63 => 
                array (
                    'name' => 'summary',
