                    'updated_at' => '2018-04-28 12:35:36',
                ),
                64 => 
                array (
                    'name' => 'summary',
                    'value' => 'There are multiple artists with this name:

1) Iron Maiden are an English heavy metal band formed in Leyton, east London, in 1975 by bassist and primary songwriter Steve Harris. The band\'s discography has grown to thirty-seven albums, including fifteen studio albums, eleven live albums, four EPs, and seven compilations.

Pioneers of the New Wave of British Heavy Metal, Iron Maiden achieved initial success during the early 1980s. After several line-up changes <a href="https://www.last.fm/music/Iron+Maiden">Read more on Last.fm</a>',
                'artist_id' => 68,
                'created_at' => '2018-04-28 12:35:37',
                'updated_at' => '2018-04-28 12:35:37',
            ),
            65 => 
            array (
                'name' => 'summary',
                'value' => '
Jack White (born John Anthony Gillis on July 9, 1975 in Detroit), American rock musician, producer, and actor. He is best known as the guitarist and lead vocalist of the rock duo The White Stripes (1997-2011) and more recently guitarist and vocalist of The Raconteurs, and drummer and vocalist for the band The Dead Weather.

Jack White first played as a professional musician in the early 1990s, as a drummer for the Detroit cowpunk band Goober & the Peas. <a href="https://www.last.fm/music/Jack+White">Read more on Last.fm</a>',
                'artist_id' => 69,
                'created_at' => '2018-04-28 12:35:39',
                'updated_at' => '2018-04-28 12:35:39',
            ),
            66 => 
            array (
                'name' => 'summary',
            'value' => 'James Taylor (born 12th March 1948) is an American singer-songwriter and guitarist, born in Boston, Massachusetts. He grew up in Chapel Hill, North Carolina, where his father Isaac Taylor was the dean of the University of North Carolina Medical School. His family summered on Martha\'s Vineyard.

Taylor\'s career began in the mid-1960s, and was the first artist signed to The Beatles\'s Apple Records. He found further success in the early 1970s, singing sensitive and gentle acoustic songs. <a href="https://www.last.fm/music/James+Taylor">Read more on Last.fm</a>',
                'artist_id' => 70,
                'created_at' => '2018-04-28 12:35:40',
                'updated_at' => '2018-04-28 12:35:40',
            ),
            67 => 
            array (
                'name' => 'summary',
                'value' => 'Jefferson Airplane was a psychedelic rock group formed in San Francisco. It was the first of several Bay Area psychedelic groups of the 1960s to become internationally known. The band was founded by singer Marty Balin and guitarist Paul Kantner in 1965. With the addition of Signe Anderson, their male-female singing style showed their folk music roots plus Balin\'s love of R&B singing styles. In fact their dual lead vocals were a hallmark of their sound throughout the Airplane\'s career <a href="https://www.last.fm/music/Jefferson+Airplane">Read more on Last.fm</a>',
                'artist_id' => 71,
                'created_at' => '2018-04-28 12:35:42',
                'updated_at' => '2018-04-28 12:35:42',
            ),
            68 => 
            array (
                'name' => 'summary',
            'value' => '1. Jet was an alternative rock band which formed in 2001 in Melbourne, Australia. The band consists of Nic Cester (vocals, guitar), Cameron Muncey (guitar, vocals), Mark Wilson (bass) and Chris Cester (drums). They released three albums: "Get Born" (2003), "Shine On" (2006) and "Shaka Rock" (2009). The band has had international hits with the singles "Are You Gonna Be My Girl", "Look What You\'ve Done", "Put Your Money Where Your Mouth Is" and "She\'s A Genius". The band split in March 2012. <a href="https://www.last.fm/music/Jet">Read more on Last.fm</a>',
                'artist_id' => 72,
                'created_at' => '2018-04-28 12:35:44',
                'updated_at' => '2018-04-28 12:35:44',
            ),
            69 => 
            array (
                'name' => 'summary',
            'value' => 'James Marshall "Jimi" Hendrix (born Johnny Allen Hendrix; 27th November at Seattle\'s King County Hospital, 1942 - 18th September 1970) was a U.S. guitarist, singer, and songwriter.

Hendrix was not very popular in the U.S.A. at the outset of his musical career, only later gaining recognition after taking a trip to England in 1966 with The Animals\' Chas Chandler, where he subsequently formed The Jimi Hendrix Experience with bassist Noel Redding and drummer Mitch Mitchell. <a href="https://www.last.fm/music/Jimi+Hendrix">Read more on Last.fm</a>',
                'artist_id' => 73,
                'created_at' => '2018-04-28 12:35:45',
                'updated_at' => '2018-04-28 12:35:45',
            ),
            70 => 
            array (
                'name' => 'summary',
            'value' => 'John Winston Ono Lennon, MBE (born John Winston Lennon; 9 October 1940 – 8 December 1980) was an English singer, songwriter, musician, and activist who co-founded The Beatles, the most commercially successful and musically influential band in the history of popular music. He and fellow member Paul McCartney formed a much-celebrated songwriting partnership.

Born and raised in Liverpool, Lennon became involved in the skiffle craze as a teenager. He formed his first band, the Quarrymen, in 1957 which evolved into the Beatles in 1960. <a href="https://www.last.fm/music/John+Lennon">Read more on Last.fm</a>',
                'artist_id' => 74,
                'created_at' => '2018-04-28 12:35:47',
                'updated_at' => '2018-04-28 12:35:47',
            ),
            71 => 
            array (
                'name' => 'summary',
            'value' => 'Johnny Cash (born J.R. Cash, February 26, 1932 – September 12, 2003) was a Grammy Award-winning American country singer and songwriter. 

Cash is widely considered to be one of the most influential American musicians of the 20th century.  Although primarily remembered as a country music icon, his genre-spanning songs and sound embraced rock and roll, rockabilly, blues, folk, and gospel. This crossover appeal won Cash the rare honor of multiple induction in the Country Music, Rock and Roll, and Gospel Music Halls of Fame. <a href="https://www.last.fm/music/Johnny+Cash">Read more on Last.fm</a>',
                'artist_id' => 75,
                'created_at' => '2018-04-28 12:35:48',
                'updated_at' => '2018-04-28 12:35:48',
            ),
            72 => 
            array (
                'name' => 'summary',
                'value' => 'There are at least three artists with this name
1. A popular American rock band
2. A British psychedelic trance producer
3. An underground rapper

Journey is an American rock band formed in San Francisco, California in 1973. The band has gone through several phases since its inception by former members of Santana. The band\'s greatest commercial success came in the late 1970s through the early 1980s with a series of power ballads and songs such as "Don\'t Stop Believin\'" <a href="https://www.last.fm/music/Journey">Read more on Last.fm</a>',
                'artist_id' => 76,
                'created_at' => '2018-04-28 12:35:50',
                'updated_at' => '2018-04-28 12:35:50',
            ),
            73 => 
            array (
                'name' => 'summary',
            'value' => 'Joy Division were a post-punk band formed in 1976 in Salford, Greater Manchester, United Kingdom. Originally named Warsaw, the band consisted of Ian Curtis (vocals and occasional guitar), Bernard Sumner (guitar and keyboards), Peter Hook (bass guitar and backing vocals) and Stephen Morris (drums and percussion). The band dissolved in May 1980 after the suicide of its lead singer, Ian Curtis. Much of their popularity/reputation arguably resulted from frequent playings on air by iconic DJ John Peel <a href="https://www.last.fm/music/Joy+Division">Read more on Last.fm</a>',
                'artist_id' => 77,
                'created_at' => '2018-04-28 12:35:52',
                'updated_at' => '2018-04-28 12:35:52',
            ),
            74 => 
            array (
                'name' => 'summary',
            'value' => 'Justin Drew Bieber (born March 1, 1994) is a Canadian pop musician, actor, and singer-songwriter. Bieber was discovered in 2008 by American talent manager Scooter Braun, who came across Bieber\'s videos on YouTube and later became his manager. Braun arranged for him to meet with entertainer Usher Raymond in Atlanta, Georgia. Bieber was signed to Raymond Braun Media Group (RBMG), and then to an Island Records recording contract offered by record executive L.A. Reid. <a href="https://www.last.fm/music/Justin+Bieber">Read more on Last.fm</a>',
                'artist_id' => 78,
                'created_at' => '2018-04-28 12:35:54',
                'updated_at' => '2018-04-28 12:35:54',
            ),
            75 => 
            array (
                'name' => 'summary',
            'value' => 'Kanye Omari West (born June 8, 1977 in Atlanta, Georgia) is a Grammy award winning rapper, producer, author, designer and singer. 

He began making beats and rapping in the early 90s in Chicago, IL, United States when he formed the rap group Go Getters with Chicago natives GLC and Really Doe. He later gained nationwide popularity in New York when he began producing tracks for artists such as Jay-Z, Twista, Mase, Talib Kweli and Alicia Keys. 

West’s style of production often utilizes pitched-up vocal samples <a href="https://www.last.fm/music/Kanye+West">Read more on Last.fm</a>',
                'artist_id' => 80,
                'created_at' => '2018-04-28 12:35:57',
                'updated_at' => '2018-04-28 12:35:57',
            ),
            76 => 
            array (
                'name' => 'summary',
            'value' => 'Kasabian are a rock band from Leicester, England, United Kingdom. The band consists of Tom Meighan (vocals), Sergio Pizzorno (guitar, synths, vocals), Christopher Edwards (bass),  Ian Matthews (drums) and guitarist Tim Carter. The band has been compared with the likes of Primal Scream, with their similar electronica-indie rock fusion and Oasis, with whom they share their confidence, vision, swagger and rough vocal style.

The band formed in 1997 in Leicester <a href="https://www.last.fm/music/Kasabian">Read more on Last.fm</a>',
