            77 => 
            array (
                'name' => 'summary',
                'value' => 'Keane is an English rock band, first established in Battle, East Sussex, United Kingdom in 1995, taking their current name in 1997. The group is comprised of composer, bassist, and pianist Tim Rice-Oxley, lead vocalist Tom Chaplin and drummer Richard Hughes. Their original line-up included founder and guitarist Dominic Scott, who left in 2001. For their 2008 album "Perfect Symmetry" and the following tour, Jesse Quin joined the band on stage to play bass. <a href="https://www.last.fm/music/Keane">Read more on Last.fm</a>',
