            78 => 
            array (
                'name' => 'summary',
                'value' => 'Kool & the Gang are an American jazz/R&B/soul/funk/disco group. They originally formed in Jersey City, New Jersey, U.S. in 1964. They went through several musical phases in their career, starting out with a purist jazz sound, becoming practitioners of R&B and funk, progressing to a smooth disco ensemble, and ended the successful period of their career producing pop/R&B crossovers. They have sold over 70 million albums worldwide. <a href="https://www.last.fm/music/+noredirect/Kool+and+the+Gang">Read more on Last.fm</a>',
