            79 => 
            array (
                'name' => 'summary',
            'value' => 'Kula Shaker are a britpop/psychedelic rock band that formed in London, England in 1995, disbanded in 1999 and then reformed in 2004, widely known for their international top 40 hits "Hey Dude" (in 1996) and "Hush" (in 1997). The band\'s original line-up was Crispian Mills (vocals, guitar), Alonza Bevan (bass, vocals), Jay Darlington (organ, vocals) and Paul Winterhart (drums), When they reformed in 2004, Darlington was replaced by Harry Broadbent.  <a href="https://www.last.fm/music/Kula+Shaker">Read more on Last.fm</a>',
