                'name' => 'summary',
            'value' => 'Stefani Joanne Angelina Germanotta (born March 28, 1986), who performs under the stage name Lady Gaga, is a singer, songwriter and musician from New York City, New York, United States. 

Before Gaga adopted her stage name she was in a band called Stefani Germanotta Band. She released her first EP, “Red and Blue", in early 2006. The following year, music producer Rob Fusari dubbed her Lady Gaga, inspired by the Queen song "Radio Ga Ga". After this <a href="https://www.last.fm/music/Lady+Gaga">Read more on Last.fm</a>',
