            82 => 
            array (
                'name' => 'summary',
            'value' => 'Led Zeppelin were an English rock band originally formed in 1968 by guitarist Jimmy Page under the name "The New Yardbirds", based on Page\'s previous band, The Yardbirds. The band formed when Jimmy Page (guitar) recruited Robert Plant (vocals, harmonica), John Paul Jones (bass guitar, keyboards, mandolin), and John Bonham (drums). With their heavy, guitar-driven blues-rock sound, Led Zeppelin are regularly cited as one of the progenitors of heavy metal and hard rock music. <a href="https://www.last.fm/music/Led+Zeppelin">Read more on Last.fm</a>',
