                'name' => 'summary',
            'value' => 'Lily Rose Beatrice Cooper (née Allen; born 2 May 1985), known professionally as Lily Allen, is an English singer/songwriter, haling from London, United Kingdom and actress. She is the daughter of Keith Allen and film producer Alison Owen. Allen left school when she was 15 and concentrated on improving her performing and compositional skills. She started her musical career in 2002 by signing to London Records. In 2005, she made some of her recordings <a href="https://www.last.fm/music/Lily+Allen">Read more on Last.fm</a>',
