            86 => 
            array (
                'name' => 'summary',
            'value' => 'David Lubega (aka Lou Bega) (born April 13, 1975 in Munich, Germany) is a Latin pop musician famous for his song "Mambo No. 5".  This song is a remake of the Perez Prado instrumental from 1952. Bega added new lyrics to the song and sampled the original version extensively.

Bega had a multicultural upbringing as his mother is Sicilian and his father is from Uganda. Bega spent time in Miami during his teenage years.

"Mambo No. 5" became an instant worldwide hit <a href="https://www.last.fm/music/Lou+Bega">Read more on Last.fm</a>',
