            88 => 
            array (
                'name' => 'summary',
            'value' => 'Lynyrd Skynyrd (pronounced /ˌlɛnərd ˈskɪnərd/ LEN-ərd-SKIN-ərd) is a Southern Rock band, formed in Jacksonville, Florida, USA in 1964. The band became prominent in the Southern United States in 1973, and rose to worldwide recognition before three members and one road crew member died in an airplane crash in 1977. The band reformed in 1987 for a reunion tour with lead singer Ronnie Van Zant\'s younger brother Johnny as the frontman. Lynyrd Skynyrd continues to tour and record. <a href="https://www.last.fm/music/Lynyrd+Skynyrd">Read more on Last.fm</a>',
