'name' => 'summary',
'value' => 'Madonna Louise Ciccone (born on 16 August 1958 in Bay City, Michigan, United States), known simply as Madonna, is a recording artist, entrepreneur and occasional actress, often referred to as The Queen of Pop. Throughout her career, many of her songs have hit number one on international music charts, including Like a Virgin, Papa Don\'t Preach, Like a Prayer, Vogue, Frozen, Music, Hung Up,  and 4 Minutes (feat. Justin Timberlake & Timbaland). Madonna <a href="https://www.last.fm/music/Madonna">Read more on Last.fm</a>',
