91 => 
array (
'name' => 'summary',
'value' => 'Marilyn Manson is an American rock band from Fort Lauderdale, Florida, United States formed in 1989 by frontman Marilyn Manson and Daisy Berkowitz. The group was originally named Marilyn Manson & the Spooky Kids, with their theatrical performances gathering a local cult following in the early 1990s, until the band shortened the name in 1992. The band\'s lineup has changed between many of their album releases; the current members of Marilyn Manson are the eponymous lead singer (the only remaining original member) <a href="https://www.last.fm/music/Marilyn+Manson">Read more on Last.fm</a>',
