'name' => 'summary',
'value' => 'Maroon 5 is an American pop rock band that originated in Los Angeles, California, United States. The group was formed in 1994 as Kara\'s Flowers while its members were still in high school and originally consisted of Adam Levine (lead vocals, guitar), Jesse Carmichael (guitar, backing vocals) Mickey Madden (bass guitar) and Ryan Dusick (drums). Kara\'s Flowers signed to Reprise Records and released an album, "The Fourth World", in 1997. After a tepid response to the album <a href="https://www.last.fm/music/Maroon+5">Read more on Last.fm</a>',
