93 => 
array (
'name' => 'summary',
'value' => 'Marvin Pentz Gay, Jr. (2 April 1939 - 1 April 1984) was an American soul and rnb singer, songwriter, producer, and multi-instrumentalist, known as "The Prince of Soul", or "The Prince of Motown." Originally a member of the doo-wop group The Moonglows, he pursued a solo career after the group disbanded and released many successful solo hits including "I Heard It Through the Grapevine", "Let\'s Get It On" and  "What\'s Going On". His best albums are still held in extremely high regard, and he is often cited as one of the finest singers of his era. <a href="https://www.last.fm/music/Marvin+Gaye">Read more on Last.fm</a>',
