97 => 
array (
'name' => 'summary',
'value' => '(For the 70s British rock band, see Mr Big.)

Mr. Big combined two popular musical trends of the rock scene in the mid to late 80s: a particular brand of hard rock focused on melodies and listener-friendly choruses made for the arena, and impressive technical proficiency, then called shredding. The seeds for the group were sown when bass player Billy Sheehan (considered one of the top bassists of rock, often thought to be the bass equivalent of guitarist Eddie Van Halen) left David Lee Roth\'s solo band in 1988. <a href="https://www.last.fm/music/Mr.+Big">Read more on Last.fm</a>',
