99 => 
array (
'name' => 'summary',
'value' => 'Neil Leslie Diamond (born January 24, 1941) is an American singer and songwriter, born in Brooklyn, NY.

From the 1960s to the 1980s, Diamond was one of the more successful pop music performers, scoring a number of hits. As critic William Ruhlmann writes, "as of 2001, he claimed worldwide record sales of 115 million copies, and as of 2002 he was ranked third, behind only Elton John and Barbra Streisand, on the list of the most successful adult contemporary artists in the history of the Billboard chart. <a href="https://www.last.fm/music/Neil+Diamond">Read more on Last.fm</a>',
