'name' => 'summary',
'value' => 'Paloma Faith (born Paloma Faith Blomfield born in Hackney, London on July 21, 1981) is an English singer and actress. Her music is influenced by soul and jazz and her singing style has been compared favourably to that of Amy Winehouse and Duffy.

Her debut single, Stone Cold Sober, was released in June 2009 and entered the British charts at number 17, while her second single New York reached number 15. Her debut album Do You Want the Truth or Something Beautiful? was released on 28 September 2009 <a href="https://www.last.fm/music/Paloma+Faith">Read more on Last.fm</a>',
