'name' => 'summary',
'value' => 'Paolo Giovanni Nutini (b. 1987) is a Scottish  singer-songwriter.  His influences include David Bowie, Damien Rice, Oasis, The Beatles, U2, Pink Floyd and Fleetwood Mac.

Born on born 9th January 1987 in Paisley, Scotland, his father is of Italian descent and his mother Glaswegian, although his father\'s family have been in Scotland for four generations.  Nutini had no formal music training, and was expecting to follow his father into the family fish and chip shop business. <a href="https://www.last.fm/music/Paolo+Nutini">Read more on Last.fm</a>',
