'value' => 'Primal Scream are an alternative rock band from Glasgow, Scotland, originally formed in 1982 by Bobby Gillespie and Jim Beattie. The current lineup include Bobby Gillespie (vocals; former The Wake bassist and The Jesus & Mary Chain drummer), Andrew Innes (guitars), Barrie Cadogan (guitars), Martin Duffy (keyboards; former Felt keyboardist), Debbie Googe (bass) and Darrin Mooney (drums). Other important members were Robert "Throb" Young (guitars from <a href="https://www.last.fm/music/Primal+Scream">Read more on Last.fm</a>',
