),
119 => 
array (
'name' => 'summary',
'value' => 'Pulp are an alternative rock band that formed in 1978 in Sheffield, England, United Kingdom. The band\'s best known and most stable lineup consists of Jarvis Cocker (vocals), Russell Senior (guitar, violin), Mark Webber (guitar), Candida Doyle (keyboards), Steve Mackey (bass) and Nick Banks (drums). Although many members have had a long tenure with the band, the only constant member has been Cocker. In 2011, it was announced on Pulp\'s official website that the band\'s classic lineup would reunite and perform at several festivals <a href="https://www.last.fm/music/Pulp">Read more on Last.fm</a>',
'artist_id' => 126,
