'value' => 'Richard Ashcroft (born Richard Paul Ashcroft, on September 11, 1971, in Billinge, Wigan, England) is best known as the front man of The Verve, which he helped form in 1989.

After that band\'s demise in 1999, Ashcroft began his solo career, releasing alone with everybody in 2000, human conditions in 2002 and keys to the world in 2006. He performed vocals for the track Lonely Soul on UNKLE\'s 1998 release Psyence Fiction and his voice can also be heard on the The Chemical Brothers\' album Come With Us track The Test. <a href="https://www.last.fm/music/Richard+Ashcroft">Read more on Last.fm</a>',
