130 => 
array (
'name' => 'summary',
'value' => 'The Rolling Stones are an English rock band formed in London in April 1962 by guitarist and harmonica player Brian Jones, pianist Ian Stewart, vocalist Mick Jagger and guitarist Keith Richards. Bassist Bill Wyman and drummer Charlie Watts completed the early lineup. Rhythm and blues cover songs dominated The Rolling Stones\' early material; they are credited for raising the international regard for the more primitive blues typified by Chess Records\' artists such as Muddy Waters who wrote "Rollin\' Stone", the song after which the band is named. <a href="https://www.last.fm/music/+noredirect/Rolling+Stones,+The">Read more on Last.fm</a>',
