),
131 => 
array (
'name' => 'summary',
'value' => 'Roy Kelton Orbison (April 23, 1936 – December 6, 1988), nicknamed "The Big O", was an influential American singer-songwriter and a pioneer of rock and roll, whose recording career spanned more than four decades. By the mid-1960s Orbison was internationally recognized for his ballads of lost love, rhythmically advanced melodies, three-octave vocal range, characteristic dark sunglasses, and sometimes distinctive usage of falsetto, typified in songs such as "Only the Lonely, "Oh, Pretty Woman", and "Crying". <a href="https://www.last.fm/music/Roy+Orbison">Read more on Last.fm</a>',
