134 => 
array (
'name' => 'summary',
'value' => 'Semisonic is a power pop/alternative rock band formed in Minneapolis, Minnesota, U.S.A. Known for their signature song "Closing Time", the band members are Dan Wilson (guitar/vocals), John Munson (bass), and Jacob Slichter (drums). Although on hiatus since the early-00s, sporadic reunions have occurred.

After the breakup of Trip Shakespeare, Dan Wilson and John Munson joined up with drummer Jacob "Jake" Slichter to form Semisonic in 1995. An E.P. <a href="https://www.last.fm/music/Semisonic">Read more on Last.fm</a>',
