135 => 
array (
'name' => 'summary',
'value' => 'Sheryl Suzanne Crow (born February 11, 1962) is an American blues rock singer, guitarist, bassist, pianist and songwriter. Her music blends country, pop, folk, and blues rock into one mainstream sound, and she has won nine Grammy Awards. Crow is also a noted political activist.

Crow was born in Kennett, Missouri. Her parents were members of a local big band in which her father, an attorney, played trumpet. The family was very musical and owned three pianos. <a href="https://www.last.fm/music/Sheryl+Crow">Read more on Last.fm</a>',
'artist_id' => 142,
'created_at' => '2018-04-28 12:37:37',
'updated_at' => '2018-04-28 12:37:37',
),
136 => 
array (
'name' => 'summary',
'value' => 'Dame Shirley Veronica Bassey, (born January 8, 1937), is a Welsh singer, perhaps best-known for performing the theme songs to the James Bond films Goldfinger(1964), Diamonds Are Forever(1971), and Moonraker(1979). She is the only singer to have recorded more than one James Bond theme song.

She now resides in Monaco, and has recently sold her London apartment. Many of its furnishings were auctioned for charity. Two very popular \'Audiences With Shirley Bassey\' have aired on British TV, the most recent being in March 2006. <a href="https://www.last.fm/music/Shirley+Bassey">Read more on Last.fm</a>',
'artist_id' => 143,
'created_at' => '2018-04-28 12:37:40',
'updated_at' => '2018-04-28 12:37:40',
),
