139 => 
array (
'name' => 'summary',
'value' => 'Soft Cell are an electronic music duo that came to prominence in the early 80s. They consist of vocalist Marc Almond and instrumentalist David Ball. The duo is most widely known for their 1981 worldwide hit version of "Tainted Love" and influential multi-platinum debut \'\'Non-Stop Erotic Cabaret\'\'. In the UK, they had five Top 5 hits, including "Bedsitter", "Say Hello, Wave Goodbye", "Torch" and "What!", and also had four Top 20 albums between 1981 and 1984. <a href="https://www.last.fm/music/Soft+Cell">Read more on Last.fm</a>',
