140 => 
array (
'name' => 'summary',
'value' => 'Steppenwolf is a rock band which formed in Los Angeles, California, United States in 1967. The band originally consisted of John Kay (vocals, guitar), Michael Monarch (guitar), Rushton Moreve (bass), Goldie McJohn (keyboards) and Jerry Edmonton (drums). The band is best known for their hit singles "Born to be Wild" and "Magic Carpet Ride". They were named after the novel Der Steppenwolf by German author Hermann Hesse.

Frontman John Kay\'s mother escaped with him at age 4 from Soviet occupied East Germany <a href="https://www.last.fm/music/Steppenwolf">Read more on Last.fm</a>',
'artist_id' => 147,
