),
141 => 
array (
'name' => 'summary',
'value' => 'Stereophonics are a Welsh rock band, formed in 1992 in Cwmaman, Wales, United Kingdom, by friends Kelly Jones (guitar/vocals), Stuart Cable (drums; died 2010) and Richard Jones (bass) but no relation to Kelly. Colloquially known to their fans as the \'Phonics or the Stereos, in the years preceding their popularity, they went through shifting line-ups and were known by a variety of names including "KDR", "Zephyr", "Silent Runner", "Blind Faith" and their most widely known pre-Phonics moniker "Tragic Love Company <a href="https://www.last.fm/music/Stereophonics">Read more on Last.fm</a>',
