'name' => 'summary',
'value' => 'Stevie Wonder is the stage name of Stevland Hardaway Morris (b. Stevland Hardaway Judkins, 13 May 1950 in Saginaw, MI, USA - a.k.a. Little Stevie Wonder), a singer-songwriter, multi-instrumentalist, record producer and activist.  He débuted, as Little Stevie Wonder, with the single "I Call It Pretty Music, But the Old People Call It the Blues" (1961, Tamla Motown) and his latest album is "A Time 2 Love" (Oct 2005, Motown)

