146 => 
array (
'name' => 'summary',
'value' => 'Survivor is an American rock band formed in 1977 by core members Jim Peterik and Frankie Sullivan. The band achieved its greatest success in the 1980s with its album-oriented rock (AOR), which garnered many charting singles, especially in the United States. They had hits like "Eye of the Tiger",  "Burning Heart" (US #2), "The Search Is Over" (#4 US), and "High on You" (#8 US). 

The band tweaked its musical direction in 1988 with the release of the slightly heavier Too Hot to Sleep <a href="https://www.last.fm/music/Survivor">Read more on Last.fm</a>',
