147 => 
array (
'name' => 'summary',
'value' => 'T.Rex were an English rock band fronted by guitarist, singer and songwriter Marc Bolan. Formed as Tyrannosaurus Rex in 1960s London, the folk rock group\'s debut album My People Were Fair and Had Sky in Their Hair... 
But Now They\'re Content to Wear Stars on Their Brows (1968) which reached number 15 in the UK. In the 1970s, they achieved mainstream success as a glam rock band with hits such as "Hot Love", "Get It On", "Telegram Sam" and "Metal Guru". <a href="https://www.last.fm/music/+noredirect/T-Rex">Read more on Last.fm</a>',
