),
149 => 
array (
'name' => 'summary',
'value' => 'Taylor Alison Swift (born December 13, 1989 in Wyomissing, Pennsylvania) is an American pop (formerly country) singer-songwriter and actress. Swift is a 10-time Grammy winner with a total of 23 nominations (Feb 2016).  As of July 2015, Swift has sold 40 million albums and 130 million singles worldwide.

In 2006, she released her debut single "Tim McGraw", then her self-titled debut album, which was subsequently certified multi-platinum by the Recording Industry Association of America. <a href="https://www.last.fm/music/Taylor+Swift">Read more on Last.fm</a>',
