),
153 => 
array (
'name' => 'summary',
'value' => 'Thin Lizzy are an Irish hard rock band who formed in Dublin, Ireland in 1969. The band were led throughout their recording career by bassist, songwriter and singer Phil Lynott, and are best known for their songs Whiskey in the Jar, Jailbreak and The Boys Are Back in Town, all major international hits still played regularly on hard rock and classic rock radio stations. After Lynott died, various incarnations of the band have emerged over the years culminating in a more stable line-up based around guitarists Scott Gorham and John Sykes. <a href="https://www.last.fm/music/Thin+Lizzy">Read more on Last.fm</a>',
