),
154 => 
array (
'name' => 'summary',
'value' => 'Traditional music is an umbrella term for all folk music that has made it down the generations largely thanks to oral tradition. The obscure and random inception of such songs means that the original author(s) of the song is rarely documented. Rather, the song by time becomes part of a country\'s or ethnic group\'s canon of folk songs, usually sung by groups of people performing a custom particular to their culture (ex. pub songs, sea shanties, football anthems, lullabies, children\'s songs, working songs, dancing tunes etc..).  <a href="https://www.last.fm/music/Traditional">Read more on Last.fm</a>',
