'value' => 'The Waterboys are a band formed in 1983 by Mike Scott. The band\'s membership, past and present, has been composed mainly of musicians from Scotland, Ireland and England. Edinburgh, London, Dublin, Spiddal, New York, and Findhorn have all served as homes for the group. The band has played in a number of different styles, but their music is a mix of Celtic folk music with rock and roll. After ten years of recording and touring, they dissolved in 1993 and Scott pursued a solo career. <a href="https://www.last.fm/music/+noredirect/Waterboys">Read more on Last.fm</a>',
