'value' => 'Yeah Yeah Yeahs are an American indie rock/post-punk band formed in New York City, New York in the late summer of 2000 by Karen O, born Karen Lee Orzolek (vocals), Nick Zinner (guitar, keyboards) and Brian Chase (drums). The group\'s music melds genres ranging from art punk and garage rock to electronic and new wave. Karen O is known for her screaming, bluesy vocals and energetic stage presence, complemented by her outrageously colorful costumes.
