array (
'name' => 'summary',
'value' => ' はっぴいえんど (Happy End) was a Japanese folk rock band that existed between 1970 and 1973.

Happy End’s albums blended Western folk singing with Japanese melodies. Its members were 細野晴臣 (Haruomi Hosono, bass, vocals), 松本隆 (Takashi Matsumoto, drums, from the band Apryl Fool), 大瀧詠一 (Eiichi Ohtaki, guitar, vocals), and 鈴木茂 (Shigeru Suzuki, guitar, vocals). They originally belonged to the URC Records recording label, and later the Bellwood Records label. <a href="https://www.last.fm/music/%E3%81%AF%E3%81%A3%E3%81%B4%E3%81%84%E3%81%88%E3%82%93%E3%81%A9">Read more on Last.fm</a>',
