'value' => 'Candies (キャンディーズ) was a famous Japanese idol group formed in 1973, their first single being "あなたに夢中" (Anata ni Muchu). Candies was composed of three girls: Ran Ito (伊藤蘭) called Ran, Yoshiko Tanaka (田中好子) called Sue and Miki Fujimura (藤村美樹) called Miki. They had overwhelming popularity among young Japanese people.

