'value' => 'Spitz (スピッツ) is a rock band from Japan formed in 1987 musically influenced by artists including The Beatles and Donovan. Their début album, Spitz, was released in 1991. The group shot to fame following the release of their sixth album, Hachimitsu in 1995. Many Spitz songs were selected as theme songs for a number of TV dramas, anime, and movies in Japan, and they were also frequently adopted in TV commercials. Their 8th single, "Sora mo Toberu Hazu <a href="https://www.last.fm/music/%E3%82%B9%E3%83%94%E3%83%83%E3%83%84">Read more on Last.fm</a>',
