185 => 
array (
'name' => 'summary',
'value' => 'Yumi Matsutōya (松任谷由実, born January 19, 1954) is a Japanese singer-songwriter. She was born in Hachioji, Tokyo.  Her nickname is Yuming, which she received at the age of 13 from a Chinese artist, who inspired her to take on a career in music. Her first 4 albums are released under her maiden name, Yumi Arai (荒井由実).

In 1972, she released her debut single Henji wa Iranai (返事はいらない, "No Response Necessary"). The next year she released her first album Hikoki-gumo (ひこうき雲, "Contrail"). <a href="https://www.last.fm/music/%E6%9D%BE%E4%BB%BB%E8%B0%B7%E7%94%B1%E5%AE%9F">Read more on Last.fm</a>',
