186 => 
array (
'name' => 'summary',
'value' => 'Meiko Kaji , (born March 24, 1947 in Chiyoda, Tokyo, Japan) is a Japanese Enka singer and actress.

Meiko Kaji first began work in the film industry under the name Masako Ota at Nikkatsu studio in 1965. In 1970, with little success but extensive experience in the movie business, Meiko Kaji signed up with the Nikkatsu movie studio and was subsequently cast in more or less important roles in the Stray Cat Rock series. The films concern juvenile girl gang confrontations and, although inventive, they suffer from poor scripts throughout the series. <a href="https://www.last.fm/music/%E6%A2%B6%E8%8A%BD%E8%A1%A3%E5%AD%90">Read more on Last.fm</a>',
