),
187 => 
array (
'name' => 'summary',
'value' => 'Hibari Misora (美空 ひばり Misora Hibari, May 29, 1937 - June 24, 1989) was a Japanese singer and the predominant figure in postwar enka music. Born Kazue Kato (加藤和枝) in Yokohama, she was an accomplished singer by the age of seven, and appeared in film for the first time at age 12. Between 1949\'s Kanashiki kuchibue and 1971\'s Onna no Hanamichi, she appeared in over 60 movies.

In April of 1987, on the way to a performance in Fukuoka, she suddenly collapsed. <a href="https://www.last.fm/music/%E7%BE%8E%E7%A9%BA%E3%81%B2%E3%81%B0%E3%82%8A">Read more on Last.fm</a>',
