189 => 
array (
'name' => 'summary',
'value' => 'Yoko Takahashi (高橋洋子, Takahashi Yōko, born August 28, 1966) is a singer from Tokyo, Japan, perhaps best known for performing "残酷な天使のテーゼ" (Zankoku na tenshi no tēze, "A Cruel Angel\'s Thesis"), the opening theme tune of the anime series Neon Genesis Evangelion. She also performs the closing theme, an "acid bossa" version of "FLY ME TO THE MOON" and "魂のルフラン" (Tamashii no Rufuran, Refrain of Soul), the closing theme of Evangelion: Death and Rebirth. <a href="https://www.last.fm/music/%E9%AB%98%E6%A9%8B%E6%B4%8B%E5%AD%90">Read more on Last.fm</a>',
