),
191 => 
array (
'name' => 'summary',
'value' => 'Bobby Helms (born Robert Lee Helms) (15 August 1933 – 19 June 1997) was an American rockabilly singer who enjoyed his peak success in 1957.

Born in Bloomington, Indiana into a musical family, he began performing as a duo with his brother before going on to a successful solo career in country music. In 1956, Helms made his way to Nashville, Tennessee where he signed a recording contract with Decca Records. The following year would be filled with astonishing successes. <a href="https://www.last.fm/music/Bobby+Helms">Read more on Last.fm</a>',
