),
192 => 
array (
'name' => 'summary',
'value' => 'Brenda Lee, née Brenda Mae Tarpley (born December 11, 1944 in Atlanta, Georgia), is an American country-pop singer, who was popular during the 1950s and 1960s. In the 1960s she had more charted hits than any other woman, and only three male singers/groups (Elvis Presley, Ray Charles and The Beatles) outpaced her. She was one of the earliest pop stars to have a major contemporary international following.

She was given the nickname Little Miss Dynamite <a href="https://www.last.fm/music/Brenda+Lee">Read more on Last.fm</a>',
