),
193 => 
array (
'name' => 'summary',
'value' => 'Britney Jean Spears (born on December 2, 1981 in McComb, Mississippi, and raised in Kentwood, Louisiana, United States) is a Grammy-winning multi-platinum American pop singer, songwriter, dancer and occasional actress. She debuted in 1998 with her single ...Baby One More Time. She is one of the most influential and popular post-2000 icons of music. She also holds several world records.

She has officially released nine studio albums to date:"...Baby One More Time" (1999), "Oops!. <a href="https://www.last.fm/music/Britney+Spears">Read more on Last.fm</a>',
