array (
'name' => 'summary',
'value' => 'Peter Gene Hernandez (born October 8, 1985 in Waikiki, Hawaii), better known by his stage name Bruno Mars, is a Filipino-Puerto Rican American singer-songwriter, producer and musician signed to Atlantic Records. He has released three studio albums: Doo-Wops & Hooligans (2010, #3 USA), Unorthodox Jukebox (2012, #1 USA), and 24K Magic (2016, #2 USA). As of 2018, Mars has ten top 10 hits in the USA (and five more as a featured artist), including seven #1 singles combined : "Just the Way You Are" <a href="https://www.last.fm/music/Bruno+Mars">Read more on Last.fm</a>',
