'value' => 'Foreigner is a British-American rock band, originally formed in 1976 by the veteran English musician Mick Jones and fellow Briton and ex-King Crimson member Ian McDonald along with American vocalist Lou Gramm.

The current incarnation of the band includes Jones, lead vocalist Kelly Hansen, bass guitarist Jeff Pilson and multi-instrumentalist Tom Gimbel.

