207 => 
array (
'name' => 'summary',
'value' => 'Frankie Goes To Hollywood (FGTH) was one of the most controversial and commercially-successful U.K. pop acts of the mid-80s. The Liverpool-based new wave group was fronted by vocalist Holly Johnson and supported by Paul Rutherford (backing vocals), Peter Gill (drums), Mark O\'Toole (bass) and Brian Nash (aka  Nasher, guitar).

The group\'s debut single, titled "Relax", was famously banned by the BBC and subsequently topped the U.K. singles chart for five weeks, enjoying prolonged chart success throughout 1984. <a href="https://www.last.fm/music/Frankie+Goes+to+Hollywood">Read more on Last.fm</a>',
