211 => 
array (
'name' => 'summary',
'value' => 'Isaac Lee Hayes (born Aug 20, 1942, in Covington, Tennessee  - died Aug 10, 2008, in Memphis, Tennessee) was an influential soul singer, songwriter, musician, producer, arranger, and actor. One of the key creative forces behind Memphis\' Stax Records, Hayes began his recording career in 1962, soon playing saxophone for The Bar-Kays. Hayes and writing partner David Porter would pen numerous hits for Stax artists such as Sam & Dave ("Hold On! I\'m Comin\'", "Soul Man") and Carla Thomas ("B-A-B-Y") during the mid-1960s. <a href="https://www.last.fm/music/Isaac+Hayes">Read more on Last.fm</a>',
