'value' => 'Kate Bush (born Catherine Bush on 30 July 1958 in Bexleyheath, Kent, England, now part of Greater London) is an English singer and songwriter known for her expressive four-octave soprano voice, idiosyncratic and literary lyrics, and eclectic and meticulous musical and production style. She debuted in 1978 with the surprise hit "Wuthering Heights", which was number one in the British music charts for four weeks and the first UK number one by female artist with a self-penned song. <a href="https://www.last.fm/music/Kate+Bush">Read more on Last.fm</a>',
