217 => 
array (
'name' => 'summary',
'value' => 'Kylie Minogue (born May 28, 1968, in Melbourne, Australia) is an Australian pop singer who rose to fame after starring in the Australian TV soap Neighbours. Whilst her cover of The Loco-Motion in 1987 reached the Australian #1 spot, it was the Stock Aitken Waterman \'hit factory\' which produced her first UK chart-topper, I Should Be So Lucky, in 1988. Throughout the late 1980s, Minogue was a phenomenon in both Australia and the UK, and also saw success in Asia and Europe. <a href="https://www.last.fm/music/Kylie+Minogue">Read more on Last.fm</a>',
