218 => 
array (
'name' => 'summary',
'value' => 'Lou Monte, born Louis Scaglione on (April 2, 1917 – June 12, 1989), was an Italian-American singer best known for a number of best-selling, Italian-themed novelty records which he recorded for both RCA Records and Reprise Records in the late 1950s and early 1960s.

Monte\'s first big hit came in 1954, with the release of his version of "Darktown Strutters\' Ball." In 1962, Monte would release his first million-seller, "Pepino, the Italian Mouse." Sung in a pastiche of both Neapolitan and English <a href="https://www.last.fm/music/Lou+Monte">Read more on Last.fm</a>',
