'name' => 'summary',
'value' => 'Mariah Carey (born March 27, 1970 in Huntington, New York, United States) is a singer, songwriter, producer, actress, writer, director, model and philanthropist. Carey came to prominence following the release of her eponymous debut album in June 1990, which was certified multi-platinum and yielded four singles that topped the US Billboard Hot 100. Under the guidance of the then executive director of Columbia Records and later husband Tommy Mottola <a href="https://www.last.fm/music/Mariah+Carey">Read more on Last.fm</a>',
