220 => 
array (
'name' => 'summary',
'value' => 'Martina McBride (born Martina Mariea Schiff, July 29, 1966 in Sharon, Kansas) is an American country music singer.
Martina McBride released her honky tonk-flavored debut album The Time Has Come in 1992. Her first big hit was the single "My Baby Loves Me" from her more pop-oriented second album, 1993\'s The Way That I Am. She became even more visible in 1994 with the crossover success of her anti-domestic violence anthem "Independence Day", also from this album. <a href="https://www.last.fm/music/Martina+McBride">Read more on Last.fm</a>',
