'name' => 'summary',
'value' => '      Michael Steven Bublé (born 9 September 1975 in Burnaby, British Columbia) is a Canadian singer  and actor  who  took  Italian citizenship in 2005. 
He has won several  awards, including a Grammy  and multiple  Juno Awards. His first album reached  the top ten in Lebanon, the UK and  his home country of Canada, and achieved only modest chart success in the United States. He found worldwide commercial success with his 2005 album It\'s Time <a href="https://www.last.fm/music/+noredirect/Michael+Buble">Read more on Last.fm</a>',
