'value' => 'Nelly Kim Furtado (born in Victoria, British Columbia, Canada on December 2, 1978) is a singer, songwriter, record producer, and instrumentalist. Daughter of Portuguese parents, she also holds Portuguese citizenship.

Furtado came to fame in 2000 with the release of her debut album Whoa, Nelly!, which featured her breakthrough Grammy Award-winning single I\'m Like a Bird. After becoming a mother and releasing the less commercially successful Folklore in 2003 <a href="https://www.last.fm/music/Nelly+Furtado">Read more on Last.fm</a>',
