'value' => 'Shed Seven are a band from York, England who formed in 1990 and are  famed for their no nonsense good-time tunes and live shows. Their popularity peaked in the mid-1990\'s during the Britpop boom with their most popular songs, including Chasing Rainbows, Going For Gold, Getting Better and Disco Down, all reaching the Top 20 of the UK Singles Chart.

