230 => 
array (
'name' => 'summary',
'value' => 'The Lovin\' Spoonful is a pop/rock band that was formed in New York City, New York, United States in 1965. The band consisted of John Sebastian (vocals, autoharp), Zal Yanofsky (guitar), Steve Boone (bass) and Joseph Campbell Butler (drums). Yanofsky left the group in 1967 and was replaced by Jerry Yester, and Sebastian left the group in 1968. The band issued five albums and two film soundtracks before they split in 1969. They were inducted into the Rock and Roll Hall of Fame in 2002. <a href="https://www.last.fm/music/The+Lovin%27+Spoonful">Read more on Last.fm</a>',
