array (
'name' => 'summary',
'value' => 'Thurl Arthur Ravenscroft (February 6, 1914 – May 22, 2005) was an American voice actor and singer with a deep, booming voice. For 53 years, he was best-known as the voice of Tony the Tiger in more than 500 television commercials for Kellogg\'s Frosted Flakes.

Ravenscroft was also the vocalist of the song "You\'re A Mean One, Mr. Grinch" in the Christmas television special based on the Dr. Seuss classic How the Grinch Stole Christmas!, although his name was accidentally left off of the credits <a href="https://www.last.fm/music/Thurl+Ravenscroft">Read more on Last.fm</a>',
