'value' => 'シャ乱 (Sharan Q) is a Japanese pop-rock band formed in 1988 and consists of lead singer Tsunku (つんく♂), Hatake (はたけ) on guitar, Makoto (まこと) on drums, and Taisei (たいせい) on keyboard. Their music was a combination of rock and pop, with a little funk thrown in. Known as much for their style and clothing as their music, Sharan Q’s members often performed in outrageous looking outfits.

