241 => 
array (
'name' => 'summary',
'value' => 'Diana Ross (born Diane Ernestine Earle Ross on 26 March 1944 in Detroit, Michigan, USA) is an American soul, R&B and pop singer and actress. Ross is one of the most successful female artists of her era, both due to her solo work and her role as lead singer of The Supremes during the 1960s.

In 1959, Ross was brought to the attention of Milton Jenkins, the manager of the local doo-wop group The Primes, by Mary Wilson. Primes member Paul Williams convinced Jenkins to enlist Ross in the sister group The Primettes <a href="https://www.last.fm/music/Diana+Ross">Read more on Last.fm</a>',
