242 => 
array (
'name' => 'summary',
'value' => 'Dixie Chicks is an American country music trio which has also crossed over into other genres. Formed in 1989 in Dallas, Texas, the band is composed of founding members (and sisters) Martie Erwin Maguire and Emily Erwin Robison, and lead singer Natalie Maines. The trio is currently ranked as the highest-selling female musical group in the USA, according to RIAA Gold & Platinum album certifications. As of 2012, the Dixie Chicks had won 13 Grammy Awards. <a href="https://www.last.fm/music/Dixie+Chicks">Read more on Last.fm</a>',
