'name' => 'summary',
'value' => 'Kate Victoria Tunstall, better known as KT Tunstall (born 23 June 1975 in  Edinburgh, Scotland), is a Scottish singer-songwriter and guitarist. She broke into the public eye with a live solo performance of her song "Black Horse and the Cherry Tree" on Later... with Jools Holland. She has enjoyed commercial and critical success since, picking up three nominations before winning a BRIT Award, and a Grammy Award nomination. She is also the recipient of an Ivor Novello Award. <a href="https://www.last.fm/music/KT+Tunstall">Read more on Last.fm</a>',
