250 => 
array (
'name' => 'summary',
'value' => 'Ray Erskine Parker, Jr. (born May 1, 1954), is an American guitarist, songwriter, producer and recording artist. Parker is known for writing and performing the theme song to the motion picture Ghostbusters, for his solo hits, and performing with his band Raydio as well as the late Barry White.

Early Work
In the mid-1970s he was a sideman in Barry White\'s "Love Unlimited Orchestra", before creating Raydio, an R&B group, in 1977, with Vincent Bohnam, Jerry Knight, and Arnell Carmichael. <a href="https://www.last.fm/music/Ray+Parker+Jr.">Read more on Last.fm</a>',
