251 => 
array (
'name' => 'summary',
'value' => '“I would like if I may to take you on a strange journey” to the world’s favourite rock’n’roll musical, RICHARD O’BRIEN’S ROCKY HORROR SHOW in a brand spanking new production. 

On the way to visit an old college professor, the two clean cut kids, Brad Majors and his fiancée Janet Weiss run into tyre trouble and seek help at the strange house with a light, just down the road.

The light is coming from the Frankenstein place, where Dr Frank N Furter, is in the midst of one of his maniacal experiments …. <a href="https://www.last.fm/music/+noredirect/The+Rocky+Horror+Show">Read more on Last.fm</a>',
