253 => 
array (
'name' => 'summary',
'value' => 'Billy Idol (born William Michael Albert Broad on November 30, 1955 in Middlesex, England) is an English musician. Idol lived in Worthing before attending Sussex University for only a year before joining the Bromley Contingent of keen Sex Pistols fans. During this period, Idol decided to become a musician and formed a band called Generation X in 1976.

Generation X signed to Chrysalis Records and released three successful albums before breaking up. <a href="https://www.last.fm/music/Billy+Idol">Read more on Last.fm</a>',
