256 => 
array (
'name' => 'summary',
'value' => 'Eurythmics were a new wave duo from the United Kingdom, currently disbanded but known to reunite from time to time. Consisting of musician/producer David A. Stewart (often referred to as Dave Stewart) and singer-songwriter Annie Lennox, they formed in 1980 after the breakup of their former band The Tourists. Best known for their 1982 single "Sweet Dreams (Are Made of This)" and album of the same name, they had a striking visual image, with Lennox having a very androgynous persona. <a href="https://www.last.fm/music/Eurythmics">Read more on Last.fm</a>',
