'updated_at' => '2019-10-31 23:41:38',
),
257 => 
array (
'name' => 'summary',
'value' => 'Massive Attack are a trip-hop group which formed in Bristol, England in 1988. The group currently consists of Robert "3D" Del Naja and Grant "Daddy G" Marshall. Third member Andy "Mushroom" Vowles left the group in 1999. The band has released five studio albums: "Blue Lines" (1991), "Protection" (1994), "Mezzanine" (1998), "100th Window" (2003), and "Heligoland" (2010). On 28 January 2016, Massive Attack released a new EP, Ritual Spirit, followed by The Spoils in July. <a href="https://www.last.fm/music/Massive+Attack">Read more on Last.fm</a>',
'artist_id' => 268,
