),
258 => 
array (
'name' => 'summary',
'value' => 'Portishead are a band from Bristol, United Kingdom, named after a small coastal town twelve miles west of said musical hotbed, in North Somerset. They were initially known for their use of jazz samples and some hip-hop beats along with various synth sounds and the hauntingly beautiful vocals of singer Beth Gibbons. Their current sound drops the samples in favour of a harder, more abrasive edge, but retains Gibbons\' vocals.

The band was formed in 1991 (then later split in 2005 reforming in 2008) <a href="https://www.last.fm/music/Portishead">Read more on Last.fm</a>',
