),
260 => 
array (
'name' => 'summary',
'value' => 'Simple Minds is a Scottish pop and rock band that achieved its greatest worldwide popularity from the mid-80s to the early 90s, still playing to a massive fan-following today. The group, from the South Side of Glasgow, has produced a set of critically acclaimed albums in the early 80s. It also has secured a string of successful hit singles, the best known being their #1 worldwide hit single "Don\'t You (Forget About Me)", from the soundtrack of the John Hughes movie The Breakfast Club and their worldwide hit single "Alive and Kicking". <a href="https://www.last.fm/music/Simple+Minds">Read more on Last.fm</a>',
