),
261 => 
array (
'name' => 'summary',
'value' => 'Travis is a Scottish indie/britpop band founded in Glasgow in 1990, composed of Fran Healy (vocals, guitar), Dougie Payne (bass, vocals), Andy Dunlop (guitar, piano) and Neil Primrose (drums).

They have had a number of very successful albums to date: Good Feeling (1997), The Man Who (1999), The Invisible Band (2001), 12 Memories (2003), The Boy With No Name (2007), Ode to J. Smith (2008), Where You Stand, as well as a compilation album titled Singles (2004). Their most recent album is Everything at Once, which was released on April 29, 2016. <a href="https://www.last.fm/music/Travis">Read more on Last.fm</a>',
