263 => 
array (
'name' => 'summary',
'value' => 'There are at least two artists that go by the name of Alphaville:

1) Alphaville is a German synthpop/new wave group which gained popularity in the 80s. The founding members were Marian Gold (real name Hartwig Schierbaum, born May 26, 1954 in Herford), Bernhard Lloyd (real name Bernhard Gößling, born June 6th, 1960 in Enger, Bielefeld) and Frank Mertens (real name Frank Sorgatz, born October 26, 1961 in Enger, Bielefeld). The band was at first named Forever Young. <a href="https://www.last.fm/music/Alphaville">Read more on Last.fm</a>',
