266 => 
array (
'name' => 'summary',
'value' => 'Bonnie Tyler (born Gaynor Hopkins on 8 June 1951- Skewen, Wales, United Kingdom) is a Welsh singer, songwriter and businesswoman. Beginning as a local singer in Swansea, Tyler came to prominence with the release of her 1976 album The World Starts Tonight and its singles Lost In France and More Than A Lover. Her 1978 single It\'s A Heartache was a hit on both sides of the Atlantic, reaching number one in several European countries and breaking the American charts.  <a href="https://www.last.fm/music/Bonnie+Tyler">Read more on Last.fm</a>',
