270 => 
array (
'name' => 'summary',
'value' => 'Deacon Blue is a Scottish pop band formed in Glasgow in 1985. Their name came from the title of the Steely Dan song "Deacon Blues". Success came for the band in 1989 when their second studio album, When The World Knows Your Name, topped the UK Album Charts. The album included "Real Gone Kid" which became their first UK top ten single. After releasing further albums in 1991 and 1993, they split up in 1994. Five years later, in 1999, the band held a reunion gig and this led to the album, Walking Back Home. <a href="https://www.last.fm/music/Deacon+Blue">Read more on Last.fm</a>',
