272 => 
array (
'name' => 'summary',
'value' => 'Duran Duran (named after a character in Roger Vadim\'s sci-fi classic, Barbarella) is an electronic pop rock band that was part of the New Wave movement of the 80s and 90s. Created by Nick Rhodes (keyboards) and John Taylor (bass) in Birmingham, England in 1978, it later add took in Roger Taylor  (drums), Andy Taylor (guitar), and Simon Le Bon (lead vocals). The band has sold more than 70 million records over their more than 35 years of existence, making them one of the best-selling groups in history. <a href="https://www.last.fm/music/Duran+Duran">Read more on Last.fm</a>',
