'name' => 'summary',
'value' => 'The Hollies are an English pop and rock group, formed in Manchester in the early 1960s, though most of the band members are from throughout East Lancashire. Known for their distinctive vocal harmony style, they became one of the leading British groups of the 1960s and 1970s. They enjoyed considerable popularity in many countries, although they did not achieve major US chart success until 1966. Along with The Rolling Stones and The Searchers, they <a href="https://www.last.fm/music/+noredirect/Hollies">Read more on Last.fm</a>',
