'value' => 'James Joseph Brown (May 3, 1933 – December 25, 2006) was an American singer, songwriter, dancer, musician, record producer and bandleader. A progenitor of funk music and a major figure of 20th century popular music and dance, he is often referred to as the "Godfather of Soul". In a career that lasted 50 years, he influenced the development of several music genres.

