282 => 
array (
'name' => 'summary',
'value' => 'Neil Percival Young (born November 12, 1945) is a Canadian singer-songwriter, guitarist, and social activist who is widely regarded as one of the most influential musicians of his generation, particularly as Neil Young & Crazy Horse. Young was born in Toronto, but he moved to the family home of Winnipeg as a child, which is where his music career began. Young began performing as a solo artist in Canada in 1960, before moving to California in 1966, where he co-founded the band Buffalo Springfield along with Stephen Stills and Richie Furay. <a href="https://www.last.fm/music/Neil+Young">Read more on Last.fm</a>',
