283 => 
array (
'name' => 'summary',
'value' => 'Pet Shop Boys are a British synthpop/dance music duo, consisting of Neil Tennant and Chris Lowe. They formed in London, UK in 1982. "Super", their thirteenth studio album, was released on April 1st 2016.

Three-time Brit Award winners and six-time Grammy nominees, they have achieved 42 Top 30 singles and 22 Top 10 hits in the UK Singles Chart, including four number ones: "West End Girls", "It\'s a Sin", "Always on My Mind" and "Heart". Other songs include "Being Boring" <a href="https://www.last.fm/music/Pet+Shop+Boys">Read more on Last.fm</a>',
