),
284 => 
array (
'name' => 'summary',
'value' => 'Scissor Sisters is a four-piece glam pop / disco band, from New York City, NY, USA. The band was formed in 2000, by Jason Sellards (aka Jake Shears - lead vocals) & Scott Hoffman (aka Babydaddy - keyboard / bass). Other members are Ana Lynch (aka Ana Matronic - lead vocals) & Derek Gruen (aka Del Marquis - guitar). 
Randy Schrager (aka Randy Real), is the band\'s live drummer. Patrick Seacor (aka Paddy Boom), left band in 2008. Lyrics are largely written by Shears / Babydaddy & known for a mixture of wit & tragedy. <a href="https://www.last.fm/music/Scissor+Sisters">Read more on Last.fm</a>',
'artist_id' => 296,
