),
285 => 
array (
'name' => 'summary',
'value' => 'Seal Henry Olusegun Olumide Adeola Samuel (born February 19, 1963 in Paddington, London) is a Grammy award winning English soul singer-songwriter of Nigerian and Brazilian descent, professionally known only by his first name, Seal. A childhood battle with discoid lupus left him with distinctive facial scarring and hair loss. He released his debut studio album Seal in 1991 and has since released 1994\'s Seal II, 1998\'s Human Being, 2003\'s Seal IV, 2007\'s System and 2010\'s Commitment. <a href="https://www.last.fm/music/Seal">Read more on Last.fm</a>',
