'name' => 'summary',
'value' => 'The Shamen were an experimental electronic music band, initially formed in Aberdeen, Scotland, by Colin Angus (born 24 August 1961), Derek McKenzie (born 27 February 1964), Keith McKenzie (born 30 August 1961) and Peter Stephenson (born 1 March 1962) in the 1980s as a psychedelic-influenced indie rock act. 

