'name' => 'summary',
'value' => '
Supergrass were an alternative rock band which formed in Oxford, England in 1994. The band consisted of brothers Gaz (guitar and lead vocals) and Rob Coombes (keyboards), Mick Quinn (bass and backing vocals) and Danny Goffey (drums and backing vocals).

In summer 1994 they released their first single Caught By The Fuzz which had Strange Ones on the B side, on a small local record label called Backbeat,  run by Makating bass guitarist Dave Norland from his bedroom in a house in the Cowley Road area of Oxford. <a href="https://www.last.fm/music/Supergrass">Read more on Last.fm</a>',
