'value' => '
The Smashing Pumpkins are an alternative rock band, formed in Chicago, Illinois, USA, in 1988. Billy Corgan and James Iha met in a record store, and began performing in local nightclubs with their bassist, D\'arcy Wretzky, using a drum machine. Playing with a drum machine frustrated both the band and their audience, and so Chicago jazz drummer Jimmy Chamberlin was hired soon afterwards.

Less influenced by punk than many of their contemporaries, the Pumpkins had a densely layered <a href="https://www.last.fm/music/The+Smashing+Pumpkins">Read more on Last.fm</a>',
