291 => 
array (
'name' => 'summary',
'value' => 'Tina Turner (born Anna Mae Bullock on 26 November 1939, Nutbush, Tennessee, USA) is a Grammy-winning multi-platinum rock/soul, r&b/pop singer, songwriter, actress, and author. She is the most successful female rock artist of all time: the Acid Queen or The Queen of Rock \'n\' Roll.  She started her storied career by joining Ike Turner to form The Ike & Tina Turner Revue in 1960. They had a string of hits like A Fool in Love, It\'s Gonna Work Out Fine <a href="https://www.last.fm/music/Tina+Turner">Read more on Last.fm</a>',
