'value' => 'Sir George Ivan "Van" Morrison, OBE (generally known as Van Morrison or Van The Man) (born 31 August 1945) is a Grammy Award-winning artist from Belfast, Northern Ireland. He\'s a singer, songwriter, author, poet, and multi-instrumentalist, who has been a professional musician since 1958. He plays a variety of instruments, including the guitar, harmonica, keyboards, drums, and saxophone. Featuring his characteristic growl - a unique mix of folk, blues <a href="https://www.last.fm/music/Van+Morrison">Read more on Last.fm</a>',
